import "./App.css";

function App() {
  return (
    <div className="App">
      <div>
        <div className="heading">RAILWAY SCHEDULER</div>
        <div className="content">
          <div style="width: 20%; float:left"></div>

          <div style="width: 80%; float:right">#right content in there</div>
        </div>
      </div>
    </div>
  );
}

export default App;
